import React from 'react';
import { Form, FormGroup, Label, Input, Button } from 'react-router-dom';

const Signup = () => {
  return (
    <div className='signup-form-div'>
      <Form>
        <FormGroup>
          <Label for='username'>
            <Input 
              autoFocus 
              type='text'
              name='username'
              id='username'
              // value={formData.username}
              // onChange={handleLoginChange}  
            />
          </Label>
        </FormGroup>
      </Form>
    </div>  
  );  
}

export default Signup;
